/// contentE : "<div class='contentLicense'>\r\n    <div class='contaent-listing'>\r\n      <ol>\r\n        <li>\r\n          <h2>Definition of Golden License(Single Approval)</h2>\r\n          <p>\r\n            According to Article(20) of the Investment Law enacted by Law No. 72 of 2017 and Articles (42 and 43) of its executive regulation, the Golden License shall be defined as a single approval to set up, operate and manage the project, including building licenses, and the allocation of the real property required therefor.It may be granted to companies upon a decree of the Cabinet.This approval may include the application of one or more of the incentives mentioned in this law to the project, and this approval shall be effective by itself without need to take any other further action.\r\n          </p>\r\n\r\n        </li>\r\n        <li>\r\n          <h2>Incentives that may be granted to the companies within the Golden License</h2>\r\n          <p>\r\n\r\n           According to Article (20) of the Investment Law, the Golden License(Single approval) may include the application of one or more of the incentives stipulated in this Law to the project, and this includes the incentives stipulated in Part II of the Investment Law, which are:\r\n\r\n          </p>\r\n          <ol class='listing-notes'>\r\n            <li>General Incentives</li>\r\n            <li>Special Incentives</li>\r\n            <li>Additional Incentives</li>\r\n          </ol>\r\n\r\n        </li>\r\n        <li>\r\n          <h2>Companies that may be granted the Golden License (Single Approval)</h2>\r\n          <p>Golden License may be granted to the following companies:</p>\r\n          <p>\r\n            A- Companies established to set up strategic or national projects that contribute to achieving sustainable development in accordance with the State's economic development plan.\r\n          </p>\r\n          <p>\r\n            B- Companies established to set up partnership projects between the private sector and the State, the public sector, or the public business sector, in the activities of(public utilities and infrastructure - new and renewable energy - roads and transportation - ports - telecommunications and information technology).\r\n          </p>\r\n        </li>\r\n        <li>\r\n          <h2>Terms and Conditions for obtaining the Golden License:</h2>\r\n          <p>\r\n            In accordance with Article(42) of the executive regulation of Investment Law No. 72 of 2017, the applicants for the single approval stipulated in Article (20) of the Investment Law shall meet the following conditions:\r\n          </p>\r\n          <p>\r\n            1-\tThey shall be representing an Egyptian joint-stock company or a limited liability company in accordance with the provisions of the Investment Law enacted by Law No.72 of 2017, or law of joint stock companies, partnerships limited by shares, limited liability companies and single member companies enacted by Law No.159 of 1981;\r\n\r\n          </p>\r\n          <p>2-\tThey shall provide evidence of financial solvency for the implementation of the project;</p>\r\n          <p>\r\n            3- The company shall be established after the date of enforcement of the herein aforementioned Investment Law;\r\n          </p>\r\n          <p>\r\n            4- They shall submit a preliminary feasibility study on the project prepared by a reputable and licensed national or international consultancy firm;\r\n          </p>\r\n          <p>5-\tThey shall submit a schedule for implementing the project;</p>\r\n          <p>\r\n            6- They shall submit an acknowledgment of the provision of all utilities of the infrastructure(roads- water- sewage- electricity- communications- waste management); \r\n          </p>\r\n          <p>\r\n            7- They shall submit an acknowledgment of all requirements and controls pertaining to the company's activity in accordance with laws and regulations applied thereof. \r\n          </p>\r\n\r\n        </li>\r\n      </ol>\r\n    </div>\r\n  </div>';"
